export default function CadastroForm(){
    return(
        <form>
            <input type="text" placeholder="Nome do candidato"/>
            <input type="number" placeholder="Idade do candidato"/>

            <select name="sexo_candidato">
                <option disabled>Masculino</option>
            </select>
        </form>
    )
}
